import React from "react";

import titleStyles from './titleStyles.css';
import face from '../images/astonished-face.svg';

export default class Title extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return (
        <div>
            <div className="rainbow-border"><p className="shaking">Welcome to React Quiz!</p></div>
            <div><img src={`${face}`} width="50" height="50"></img></div>
        </div>)
    }
}
